import React from "react";
import { gql } from 'apollo-boost';
import { useQuery } from '@apollo/react-hooks';
//import { baseballActions } from '../state';
//import { useStateValue } from './BaseballApp';
//let NAME_SEARCH_URL: string = "http://192.168.1.67:5000/player?str="

interface Player {
  searchStr: string
  name: string
  id: number
}

const PLAYER_QUERY = gql`
  {
    getPlayer(searchStr: "Christian Yel")
    {
      searchStr
      name
      id
    }
  }
`;

// NameSearch function for taking text entered and searching for closest player
// whose name matches the text
function NameSearch(): any {
  // https://github.com/apollographql/apollo-client/blob/version-2.6/docs/source/data/queries.mdx
  const { loading, error, data } = useQuery(PLAYER_QUERY, {variables: { searchStr: "Christian Yelich"}});
  if (loading) return (<div>'Loading...'</div>);
  if (error) {
    console.warn(error);
    return `Error! ${error.message}`;
  }

  console.log(data);
  return (
    <div>
      {"Yoenis Cespedes"}
    </div>
  )
